function testFn(context) {
	const $ = context.jQuery;
	const submissions = $('.athing').toArray();
	return submissions.map(el => {
		const $el = $(el);
		const $next = $el.next();
		return {
			rank: $el.find('.rank').text(),
			title: $el.find('.storylink').text(),
			link: $el.find('.storylink').attr('href'),
			score: parseInt($next.find('.score').text(), 10),
			author: $next.find('.hnuser').text(),
			time: $next.find('.age').text()
		};
	});
}
